import React, {Component} from 'react';
import TodoList from '../todo-list/todo-list';

const ligbox = <span>Login please</span>;
const login = false;

const SearchPanel = () => {
    const searchStyle = {
      fontSize: '25px'
    };
    return (
      <input style = {searchStyle} placeholder = "search" />
    );
  }
  const Hed = () => {
    return (
      <h1>My to do List</h1>
    );
  }
const App = () => {
    const todoData = [
      { label: 'Drink coffee', important: false, id : 1},
      { label: 'Write code', important: true, id : 2},
      { label: 'Sleep', important: false, id :3}
    ];
    return (
      <div>
        {login ? null : ligbox }
        <Hed />
        <SearchPanel />
        <TodoList todos = {todoData} onDeleted={(id)=>console.log('del:',id)}/>
      </div>
    );
  };
  export default App;
